(89, 4, 3, 4, 3, 3, 3, 2, 3, 3, 3, 3, 34, 'DESEMPEÑO BUENO', 'Excelente dominio de los temas en sus exposiciones\r\nBuen manejo del cliente y seguimiento de las sesiones\r\nProactivo ante la solución de problemas\r\nConfiable en la delegación de responsabilidades', 'Buen manejo de los equipos que se le dan para coordinar\r\nMejorar su actitud ante sus compañeros (Se quejan de su mal humor y malas respuestas)\r\nSeguimiento y solución en tiempo y forma de pendientes.\r\nControl de temperamento ante los clientes.', 78, '133'),
(90, 4, 4, 4, 4, 4, 3, 4, 4, 4, 4, 4, 43, 'LLENAR FORMULARIO', 'Autodidacta, Autoestudio, Alta actitud de servicio al cliente', 'Mejorar la comunicación con el equipo', 122, '123'),
(91, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 33, 'DESEMPEÑO BUENO', 'Autogestion, responsable', 'Iniciativa', 54, '42'),
(92, 3, 4, 3, 4, 4, 3, 3, 4, 3, 4, 3, 38, 'LLENAR FORMULARIO', 'Trabajo en equipo\r\nComunicacion\r\nTolerncia a la frutacion \r\nCalidad en los entregables', 'Entrevista por competencias (pulir)', 303, '3'),
(93, 4, 3, 3, 3, 3, 3, 4, 3, 3, 4, 4, 37, 'EXCELENTE DESEMPEÑO', 'Torelancia a la frutación\r\nManejo de conflictos\r\nDinamismo\r\nEmpatia\r\nTrabajo en equipo y Buena comunicacion con el equipo y clientes', 'En realidad tiene buen empuje y cumplimiento, las caracteristicas a desarrollar seria la consultoria, el liderazgo y coaching para desarrollarla y que pueda tener personal a su cargo.', 18, '3'),
(94, 3, 4, 4, 3, 3, 4, 3, 3, 3, 3, 4, 37, 'EXCELENTE DESEMPEÑO', 'Analisis de información\r\nControl y seguimiento a tareas y procesos\r\nManejo de infrmación\r\nReportes y control de bases de datos', 'Pulir temas administrativos y definición de algunos procesos\r\n', 305, '3'),
(95, 3, 3, 3, 3, 2, 3, 3, 4, 4, 3, 3, 34, 'DESEMPEÑO BUENO', 'Organizado\r\nAnalitico\r\nTrabajo en equipo \r\nActitud de servicio y compromiso\r\nCumplimiento de objetivos', 'Anticiparnos a las festividades y dinamicas que sabemos van a venir \r\nTrabajar con los demas paises', 10, '3');
