(157, 'Gestión de Control de Calidad', 35, 'Garantía de calidad: Revisar que todos los desarrolladores cumplan con los estandares de calidad establecidos, medidos por revisiones de código, herramientas de análisis estático y / o informes de control de calidad (para medir la entrega de calidad)', 30, 11, 100, 80, 80, 8, '', 147, 1, 1, '68'),
(158, 'Gestión de Control de Calidad', 0, 'Planificación de la calidad: La planificación de la calidad es el proceso en el cual se desarrolla un plan de calidad para un proyecto. Define la calidad del software deseado y describe cómo debe valorarse (Elaboración de Matriz de Pruebas)', 30, 11, 100, 80, 80, 8, '', 147, 1, 2, '68'),
(159, 'Gestión de Control de Calidad', 0, 'Control de Calidad: El control de calidad considera la vigilancia del proceso de desarrollo de software para asegurar que se sigan los procedimientos y los estándares de garantía de calidad. El control de calidad incluye la comprobación de que las entregas cumplan los estándares definidos (ejecución matriz de pruebas)  al menos el 80% de los desarrollos', 40, 14, 100, 80, 80, 11, '', 147, 1, 3, '68'),
