(94, '2022-11-03', NULL, 'Mariana Perez Quintana', 'Human Resources Recruiter', 'FI:RECURSOS HUMANOS', 'Finanzas', '3', '2020-12-07', '', 74, 14, 88, 'Calidad en entregables, lo realiza muy bien y puede mejorarlos\r\nConcetración en detalles\r\nFalta ajustar estrategia de reclutamiento con sus KPI´s para poder tener mayor visibilidad con su base actualizada\r\n', 'Actitud de servicio\r\nComunicación\r\nFacilidad de palabra y relacionamiento con el cliente interno y externo\r\nTrabajo en equipo\r\nDinamismo', 'Me gustaria trabajar con Mariana el liderago y coaching para que en un futuro pueda tener personal a carga y que su pensamiento se mas estrategico y menos operativo', NULL, 18, '0', '2022-11-03', '14:34:31', '3', NULL, NULL, NULL),
(95, '2022-11-03', NULL, 'Jacquelina Luna Escamilla', 'Human Resources Generalist ', 'FI:RECURSOS HUMANOS', 'Finanzas', '3', '2022-08-08', '', 74, 14, 88, 'Para los tres meses en Netsoft, solo debemos pulir algunos procesos como Skandia, actualizacion de expedientes ', 'Mucha atención al detalle\r\nOrganización\r\nCapacidad de analisis\r\nConocimiento en temas de RRHH\r\nControl y seguimiento a tareas\r\nComunicacion y trabajo en equipo', 'El actualizado de expedientes fisicos, skandia y layout de Netsuite', NULL, 305, '0', '2022-11-03', '14:42:29', '3', NULL, NULL, NULL),
(96, '2022-11-03', NULL, 'Abraham Tarcisio Ortiz Herrera', 'Organizational Development Coordinator', 'FI:RECURSOS HUMANOS', 'Finanzas', '3', '2021-09-20', '', 74, 13, 87, 'Tener algun calendari / pla de trabajo a seguir para temas de festividades, dinamicas, de acuerdo a los requerimientos de dirección durante el año.', 'Control y manejo de información\r\nAnalisis de base de datos\r\nCreatividad y conocimiento en temas de DO\r\nEnfoque a resultados\r\nTrabajo en equipo y actitud positiva', 'Armar un pla de trabajo para el 2023 con dinamicas por areas presenciales y virtuales\r\nTener reuniones con Lus Dary Colombia y Tamara Brasil para alinear festividades y que concentremos calendarios de loos tres paises asi como ayudar a los demas paises\r\nTrabajar en la base de empleados para 2023 con todos los datos actualizados y poner tener a la mano todos los indicadores para su analisis\r\nPrepara encuesta de clima 2023', NULL, 10, '0', '2022-11-03', '14:49:51', '3', NULL, NULL, NULL);
